import "./App.css";
import Post from "./components/Post";
import Header from "./components/Header";
import { Routes, Route, BrowserRouter as Router } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <main>
              <Header />
              <Post />
              <Post />
              <Post />
            </main>
          }
        ></Route>
      </Routes>
    </Router>
  );
}

export default App;
